INSERT INTO `about_us` (`id`, `title_ar`, `desc_ar`, `title_en`, `desc_en`, `image`) VALUES
(1, 'ناشيونال ايجيبت للسياحة', 'نعرف ما تستحق -  we know what you deserve \r\nهذا هو الشعار الذي تم اختيارة منذ اليوم الاول لانشاء شركة ناشيونال ايجيبت للسياحة فى فبراير 1997 و هو يعبر عن تقديرنا الكامل لكل عملاء شركتنا المميزون لاننا و بحق نقدم كافة الخدمات التى يستحقها عميلنا الذي يثق بأننا نستطيع تلبية كافة الخدمات التى يحتاحها بأفضل شكل ممكن مقدرين تماما قيمة الوقت و المال فى حياة عملائنا.\r\n<br>\r\nرؤية ناشيونال ايجيبت قائمة على روح العائلة لذا يعتبر كافة موظفينا و عملائنا جزء من عائلتنا الكبيرة لذا كل منا يساهم بما يستطيع لنجاح هذه العائلة.\r\n<br>\r\nعندما تجتمع معانى الرفاهية مع الاحسان فى العبادة على خطى سيد الخلق سيدنا و حبيبنا و شفيعنا محمد صلى الله علية و سلم فإن الاختيار الافضل لعملائنا الكرام بالتاكيد هو ناشيونال ايجيبت للسياحة .\r\n<br>\r\nرحلات الحج و العمرة بمفهوم ناشيونال ايجيبت للسياحة ليست فقط مناسك تؤدي .  انما هى رحلة روحية تنقى الروح و القلب و الجسد و ندرك فيها المعنى الحقيقى لوجودنا فى الحياة لنصل لمرحلة السكينة و حسن الظن بالله . دور ناشيونال ايجيبت فيها هو توفير كل سبل الرعاية و الرفاهية مما يعطى عميلنا الفرصة كاملة للتفرغ للعبادة باخلاص و احسان …\r\n\r\n\r\n', 'test', 'نعرف ما تستحق -  we know what you deserve \r\nهذا هو الشعار الذي تم اختيارة منذ اليوم الاول لانشاء شركة ناشيونال ايجيبت للسياحة فى فبراير 1997 و هو يعبر عن تقديرنا الكامل لكل عملاء شركتنا المميزون لاننا و بحق نقدم كافة الخدمات التى يستحقها عميلنا الذي يثق بأننا نستطيع تلبية كافة الخدمات التى يحتاحها بأفضل شكل ممكن مقدرين تماما قيمة الوقت و المال فى حياة عملائنا \r\n<br>\r\nرؤية ناشيونال ايجيبت قائمة على روح العائلة لذا يعتبر كافة موظفينا و عملائنا جزء من عائلتنا الكبيرة لذا كل منا يساهم بما يستطيع لنجاح هذه العائلة\r\n<br>\r\nعندما تجتمع معانى الرفاهية مع الاحسان فى العبادة على خطى سيد الخلق سيدنا و حبيبنا و شفيعنا محمد صلى الله علية و سلم فإن الاختيار الافضل لعملائنا الكرام بالتاكيد هو ناشيونال ايجيبت للسياحة .\r\n<br>\r\nرحلات الحج و العمرة بمفهوم ناشيونال ايجيبت للسياحة ليست فقط مناسك تؤدي .  انما هى رحلة روحية تنقى الروح و القلب و الجسد و ندرك فيها المعنى الحقيقى لوجودنا فى الحياة لنصل لمرحلة السكينة و حسن الظن بالله . دور ناشيونال ايجيبت فيها هو توفير كل سبل الرعاية و الرفاهية مما يعطى عميلنا الفرصة كاملة للتفرغ للعبادة باخلاص و احسان …\r\n\r\n\r\n"', 's_641910_about.jpg');
