INSERT INTO `maka_madina_hotels` (`id`, `this_order`, `stars`, `countries_id`, `cities_id`, `title_ar`, `title_en`, `image`, `body_ar`, `body_en`, `desc_ar`, `desc_en`, `keywords_ar`, `keywords_en`, `star_from_campus`, `maka_or_madina_or_gada`, `currency_id`, `longitude`, `latitude`, `created_by`, `active`, `created_at`) VALUES
(53, 1, 5, 72, 74, 'دار التوحيد انتركونتيننتال', 'Dar Al Tawhid Intercontinental', 's_731582_HI277480751.jpg', 'يقع فندق دار التوحيد انتركونتيننتال ذو الـ 5 نجوم أمام المسجد الحرام، ويوفر أماكن إقامة فاخرة مُطلة على المسجد الحرام.\r\n\r\nيحتوي الفندق على غرف ضيوف واسعة ذات أثاث أنيق، وتوفر العديد من الغرف إطلالة بانورامية على المسجد الحرام، وتتميز جميع الغرف بديكور شرقي، وتشتمل على مجموعة من وسائل الراحة العصرية، بما في ذلك تلفزيونات بشاشات بلازما مع قنوات فضائية، وتتوفر خدمة الواي فاي.\r\n\r\nيحتوي الفندق على 3 مطاعم يمكن للضيوف الاختيار منها، حيث تقدم مجموعة كبيرة من المأكولات العالمية، فضلاً عن العديد من أطباق الشرق الأوسط مع إطلالات رائعة على المسجد الحرم.\r\n\r\nيقع الفندق على بُعد مسافة قصيرة من مذبح إسماعيل والجمرة الوسطى التي تبعُد مسافة 5 دقائق فقط بالسيارة. \r\n\r\n\r\n', 'Located opposite the Grand Mosque, the 5-star Dar Al Tawhid Intercontinental Makkah offers luxurious accommodation overlooking the Grand Mosque.\r\n\r\nFeaturing spacious guest rooms with elegant furnishings, many rooms offer panoramic views of the Grand Mosque. All rooms feature oriental décor and include a range of modern amenities including plasma-screen TVs with satellite channels and Wi-Fi access.\r\n\r\nThe hotel has 3 restaurants that guests can choose from, offering a wide range of international cuisine, as well as many Middle Eastern dishes with great views of the Haram Mosque.\r\n\r\nThe hotel is just a short walk from the Altar of Ismail and the Central Djamaar, only a 5-minute drive away.', 'فندق  5 نجوم أمام المسجد الحرام، ويوفر أماكن إقامة فاخرة مُطلة على المسجد الحرام.', 'A 5-star hotel facing the Grand Mosque, offers luxurious accommodation overlooking the Grand Mosque.', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(54, 1, 5, 72, 74, 'كونراد مكة', 'Conrad Mecca', 's_121084_HI319843063.jpg', 'يقع كونراد مكة في قلب مدينة مكة المكرمة إحدى الوجهات المقدسة الأكثر إلهاماً في العالم على بعد مجرد خطوات من الكعبة المشرفة والمسجد الحرام. ويمكن الوصول إلى الفندق بسهولة من طريق أم القرى المتصل بطريق مكة المكرمة-جدة السريع. كما يمكن للضيوف الاستمتاع بالمطعم الموجود في الموقع.\r\n', 'Conrad Mecca is located in the heart of Mecca, one of the most inspiring holy places in the world, just steps from the Kaaba and the Grand Mosque. The hotel is easily accessible from Umm Al-Qura road, connected to the Makkah-Jeddah highway. Guests can also enjoy the on-site restaurant.\r\n', 'يقع كونراد مكة في قلب مدينة مكة المكرمة', 'Conrad Mecca is located in the heart of Mecca,', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(55, 1, 5, 72, 74, 'هيات ريجنسي مكه', 'Hyatt Regency Mecca', 's_589099_Hyatt-Regency-Makkah-P020-Royal-Suite-Bedroom_gallery-2-3-item-panel.jpg', 'يقع فندق حياة ريجنسي مكة جبل عمر في قلب مدينة مكة المكرمة، ويبعد الفندق دقيقة واحدة فقط سيراً على الأقدام عن المسجد الحرام، ولراحة الضيف، تتوفر مواقف خاصة للسيارات مجاناً في الموقع وكذلك خدمة الواي فاي المجانية، وتتوفر أيضاً مناطق للصلاة للذكور والإناث في طابق موقف السيارات الخاص بالفندق.\r\n', 'Hyatt Regency Makkah Jabal Omar is located in the heart of Mecca, only 1 minute walk from the Grand Mosque. For guests'' convenience, free private parking is available on site and free Wi-Fi is available. The hotel''s cars.\r\n', 'يقع فندق حياة ريجنسي مكة جبل عمر في قلب مدينة مكة المكرمة', 'Hyatt Regency Makkah Jabal Omar is located in the heart of Mecca,', '', '', -3, 1, 11, '39.8192778', '21.4206751', 0, 1, '2017-03-29 14:45:41'),
(56, 1, 4, 72, 74, 'هيلتون مكة', 'Hilton mecca', 's_162949_89693106_(1).jpg', 'يطل فندق فندق مكة هيلتون على المسجد الحرام والكعبة المشرفة ويقع في قلب مدينة مكة المكرمة بالمملكة العربية السعودية. ويمكن الاستمتاع بإطلالات على الحرم المكي عند أداء الصلوات في صالتين مُكيفتين ومفروشتين بالسجاد، وتسعان 10000 مُصلي.\r\n\r\nتتميز جميع الغرف في فندق مكة هيلتون بإطلالات على مدينة مكة أو الكعبة المُشرفة أو المسجد الحرام. وتحتوي كل غرفة على مكتب وأريكة. ويتميز الجناح بغرفة معيشة منفصلة تحتوي على منطقة لتناول الطعام، وتُوفر الغرفة التنفيذية إمكانية الدخول إلى الصالة رفيعة المستوى.\r\n\r\nيتميز مطعم EL Etlalah بنوافذ مُقوسة تقليدية، ويُقدم المأكولات الآسيوية ومأكولات إقليمية خاصة.ويمكن الاستمتع بالنكهات العربية في مطعم Al Fayhaa، أو يمكن الاختيار من المأكولات العالمية الأصيلة في مطعم Lagenda. فضلاً عن الاسترخاء وتناول القهوة العربية في مقهى Cino. يمكن للضيوف الاستمتاع بمساج القدم في مركز ريفلكسولوجي الصحي .\r\n\r\nاستمتع بمول التسوق الواسع في الموقع، لما يحتويه من 450 متجر شهير وقاعة لتناول الطعام. وتضُم معالم الجذب في مكة المكرمة، والتي تقع على مقربة من فندق مكة هيلتون، الكعبة المُشرفة وبئر زمزم، فضلاً عن المواقع الإسلامية المقدسة الهامة الأخرى التي تبعُد أقل من 8 كم. \r\n\r\nهذه المنطقة المفضلة من مكة المكرمة لدى ضيوفنا بناءً على التقييمات المستقلة.\r\n\r\nمكان الإقامة هذا أيضًا أحد أفضل المواقع تقييمًا في مكة المكرمة! الضيوف مسرورون أكثر بما يقدمه مقارنة مع أماكن الإقامة في المنطقة.\r\n\r\nصُنف مكان الإقامة هذا على أنه الأفضل قيمة في مكة المكرمة! فالضيوف هنا يحصلون على مزايا أكثر مقابل ما يدفعوه بالمقارنة مع أماكن إقامة أخرى في المدينة.', 'Overlooking the Holy Haram Mosque and the Kaaba, the Makkah Hilton Hotel is in the heart of Makkah, Saudi Arabia. Pray with views of the Holy Haram in two air-conditioned and carpeted 10, 000-seat prayer halls.\r\n\r\nAll rooms at Makkah Hilton have city, mountain, Kaaba or Holy Haram Mosque views. Each provides a desk and a sofa. The suite features a separate living room with dining area and the executive room gives access to the executive lounge.\r\n\r\nEL Etlalah Restaurant, which boasts traditional arched windows, serves Asian dishes as well as regional specialties. Savor Arabic flavors at Al Fayhaa restaurant or choose authentic international cuisine at Lagenda. Relax over Arabian coffee at Caffé Cino. Guests can enjoy foot massages at the Reflexology Health Centre.\r\n\r\nExperience the extensive on site shopping mall with 450 brand shops and a food court. Makkah attractions on the doorstep of the Makkah Hilton Hotel include the Kaaba and the ZamZam Well, with other important Islamic holy sites less than 8 km away. \r\n\r\nThis is our guests'' favorite part of Mecca, according to independent reviews.\r\n\r\nThis property also has one of the top-rated locations in Mecca! Guests are happier about it compared to other properties in the area.\r\n\r\nThis property is also rated for the best value in Mecca! Guests are getting more for their money when compared to other properties in this city.', ' هيلتون مكة في قلب مكة المكرمة، وتطل على الحرم المكي الشريف', 'Hilton Mecca  is located in the heart of Mecca, overlooking the Holy Haram', '', '', 0, 3, 11, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(57, 1, 5, 72, 74, 'ماريوت مكة', 'Marriott of Mecca', 's_813578_CuAHTwoW8AAFuv6.jpg', 'يقدم فندق مكة ماريوت مكان إقامة في مكة المكرمة،ويمكن للضيوف الاستمتاع بالمطعم المتوفر في الموقع.\r\n\r\nتتميز جميع الغرف في هذا الفندق بتكييف الهواء وتلفزيون مع قنوات فضائية، وتضم غرف معينة منطقة للجلوس لإضفاء المزيد من الراحة للضيوف، وتشمل المزايا الإضافية نعال ولوازم استحمام مجانًا ومجفف للشعر.\r\n\r\nيتوفر مكتب استقبال يعمل على مدار 24 ساعة في اليوم وصالون لتصفيف الشعر ومتجر هدايا في مكان الإقامة.\r\n\r\nيقع المسجد الحرام على بعد 6 دقائق فقط من فندق مكة ماريوت، ويعتبر مطار الملك عبد العزيز المطار الأقرب لمكان الإقامة حيث يقع على بعد 74 كم منه. ', 'Makkah Marriott offers Makkah accommodation and guests can enjoy the on-site restaurant.\r\n\r\nAll rooms at this hotel feature air conditioning and satellite TV. Some rooms have a seating area for added convenience to guests. Additional benefits include slippers, complimentary toiletries and a hairdryer.\r\n\r\nThere is a 24-hour front desk, a hairdresser and a gift shop in the residence.\r\n\r\nThe Grand Mosque is only 6 minutes away from the Makkah Marriott Hotel. King Abdulaziz Airport is the closest airport to the place where it is 74 km away.', 'يقدم فندق مكة ماريوت مكان إقامة في مكة المكرمة', 'Mecca Marriott Hotel offers accommodation in Mecca', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(58, 1, 5, 72, 74, 'انجم مكه', 'Anjum Makkah', 's_26592_فندق-أنجم-مكة.jpg', 'يقع فندق أنجم مكة في مكة المكرمة ويوفر أماكن إقامة عصرية توفر إطلالات على المسجد الحرام ، ويوفر إمكانية استخدام الواي فاي مجاناً في جميع أنحاء مكان الإقامة.\r\n\r\nتوفر كل وحدة تلفزيون بشاشة مسطحة وتكييف الهواء وثلاجة صغيرة، وتحتوي الحمامات على دش ومجفف للشعر ولوازم استحمام مجانية.\r\n\r\nيمكن للضيوف الاستمتاع بخيار قائمة مأكولات محلية وعالمية في المطعم أو في الغرفة، كما تتوفر خدمة الغرف على مدار 24 ساعة.\r\n\r\nيتوفر مكتب استقبال يعمل على مدار الساعة في فندق أنجم مكة، وتشتمل المرافق الأخرى المتوفرة في مكان الإقامة على مكتب للجولات السياحية وخدمة تخزين الأمتعة.\r\n\r\nيقع الفندق على بعد 5 دقائق سيراً على الأقدام من المسجد الحرام وعلى بعد 74 كم من مطار الملك عبد العزيز. ', 'Located in Makkah, Angam Makkah Hotel offers modern accommodation with views of the Grand Mosque and offers free Wi-Fi throughout the residence.\r\n\r\nEach unit offers a flat-screen TV, air conditioning and a mini-fridge. Bathrooms come with a shower, hairdryer and free toiletries.\r\n\r\nGuests can enjoy a local and international menu option in the restaurant or in the room, and 24-hour room service is available.\r\n\r\nA 24-hour front desk is available at Anjam Makkah Hotel, and other on-site facilities include a tour desk and luggage storage.\r\n\r\nThe hotel is a 5-minute walk from the Grand Mosque and 74 km from King Abdul Aziz Airport.', 'يقع فندق أنجم مكة في مكة المكرمة ويوفر أماكن إقامة عصرية توفر إطلالات على المسجد الحرام', 'Located in Mecca, Angum Mecca Hotel offers modern accommodation with views of the Grand Mosque', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(59, 1, 5, 72, 74, 'ايلاف كندة', 'Elaf Kinda', 's_124218_100226_16062917170044246284.jpg', 'يطل فندق ايلاف كنده على الحرم الشريف وهو مكان للإقامة ذو 5 نجوم في مكة ويوفر غرفًا مُزينة بأناقة ومزودة بخدمة الواي فاي المجانية، ويمكن ترتيب خدمات تخزين الأمتعة وغسيل الملابس في مكتب الاستقبال الذي يعمل على مدار الساعة.\r\n\r\nتتميز جميع الغرف المكيفة في Elaf بأثاث خشبي داكن وأرضيات من السجاد المطبوع، وتشتمل جميعها على منطقة للجلوس مزودة بأريكة وتلفزيون بشاشة مسطحة وميني بار، ويحتوي الحمام الرخامي على دُش.\r\n\r\nيقدم الضيافة مجموعة واسعة من المأكولات العالمية والشرقية ويوفر إطلالات بانورامية على الحرم، ويقدم المجلس المعجنات اللذيذة والطازجة والوجبات الخفيفة طوال اليوم، كما تتوافر خدمة الغرف على مدار الساعة.\r\n\r\nيقع مطار جدة الدولي على بُعد 90 كم من فندق Elaf Kinda، فيما تبعُد المتاجر والمطاعم القريبة على بُعد مسافة سيرًا على الأقدام، كما يتوفر مركز لرجال الأعمال في الفندق. ', 'It offers elegantly decorated rooms with free Wi-Fi, and luggage storage and laundry services can be arranged at the 24-hour front desk.\r\n\r\nFeaturing dark wood furnishings and carpeted floors, all air-conditioned rooms at Elaf all have a seating area with a sofa, a flat-screen TV and a minibar. The marble bathroom has a shower.\r\n\r\nThe hospitality offers a wide range of international and oriental cuisine and offers panoramic views of the Haram. The Council serves delicious and fresh pastries and snacks throughout the day, and 24-hour room service is available.\r\n\r\nJeddah International Airport is 90 km from the Elaf Kinda Hotel, while nearby shops and restaurants are within walking distance, and the hotel''s business center is available.', 'يطل فندق ايلاف كنده على الحرم الشريف وهو مكان للإقامة ذو 5 نجوم في مكة', 'Overlooking Haram Al Sharif, the Elaf Kunda is a 5-star accommodation in Makkah', '', '', 0, 2, 2, '39.8242052', '21.4186645', 0, 1, '2017-03-29 14:45:41'),
(60, -1, 5, 72, 74, 'موفينبيك هاجر', 'Mövenpick Hotel & Residence Hajar Tower ', 's_44390_HI295332330.jpg', 'ويتميز بمزيج يجمع بين التقاليد ووسائل الراحة العصرية. كما يحتوي على خيارات راقية لتناول الطعام ومحلات تجارية في مكان الإقامة.\r\n\r\nتقدم الغرف في فندق وشقق موڤنبيك برج هاجر - مكة خدمة الواي فاي المجانية وتم تزيينها مع أثاث خشبي المعاصرة ويطل معظمها على المسجد الحرام والكعبة المقدسة. وتم تجهيز جميع الغرف بجهاز تلفزيون بشاشة مسطحة مع القنوات الفضائية، ومرافق صنع الشاي / القهوة وميني بار.\r\n\r\nيمكن للضيوف التمتع بالمأكولات السعودية الذواقة في مطعم النعيم ومجموعة من المأكولات الكلاسيكية العالمية في الفردوس الذي يقدم مأكولات على طراز بوفيه البيسترو. وتقدم صالة الشاي الديوان القهوة العربية ومجموعة من أنواع الشاي.\r\n\r\nيقع فندق موفنبيك برج هاجر - مكة بجوار المراكز التجارية والمجمعات الترفيهية في وسط مدينة مكة، ويوفر إطلالات على بوابة الملك عبد العزيز. كما يوفر خدمة الواي فاي المجانية في جميع المناطق العامة. ', 'Hajar Tower combines traditions with modern comforts. It features in-house shops and fine dining options.\r\n\r\nOffering free WiFi, rooms at Mövenpick Hotel & Residence Hajar Tower Makkah are decorated with contemporary wooden furnishings, most facing the Masjid al-Haram and the sacred K’aba. All rooms are equipped with a flat-screen satellite TV, tea/coffee making facilities and a minibar.\r\n\r\nGuests can enjoy gourmet Saudi specialities at the Al Naim restaurant and an array of international classics at the Al Firdaous buffet bistros. Al Diwan Tea Lounge serves Arabic coffee and selected tea blends.', 'يققع برج هاجر المطل على المسجد الحرام في أحد أطول الأبنية في العالم', 'Located in one of the tallest buildings in the world and overlooking the holy Grand Mosque', '', '', 0, 3, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(61, 1, 5, 72, 74, 'فيرمونت برج الساعه', 'Makkah Clock Royal Tower, A Fairmont Hotel', 's_304172_4039860_42_w1.jpg', 'يعتبر واحداً من أطول المباني في العالم. ويضم مركز للياقة البدنية مجهز بالكامل وحوض استحمام ساخن وساونا وغرفة بخار. ويقدم خدمات الكونسيرج على مدار الساعة.\r\n\r\nتحتوي جميع الوحدات في فندق ساعة مكة فيرمونت على تلفزيون إل سي دي وحمام داخلي فسيح مع حوض استحمام. كما تتمتع الغرف بإطلالات على الكعبة المشرفة والحرم والمدينة المقدسة.\r\n\r\nيضم فندق ساعة مكة فيرمونت 9 أماكن أكثر حداثة لتناول الطعام، تشمل Bharat ذو الطابع الهندي واستراحة Al Dar اللبنانية ومطعم Al Dira على السطح. كما يقدم الفندق قائمة خدمات شاملة للغرف على مدار الساعة.\r\n\r\n', 'luxury hotel is one of the tallest buildings in the world and is inside Makkah Clock Tower. It offers a fully equipped fitness centre, hot tub, sauna and a steam room. It includes a 24-hour concierge services.\r\n\r\nEvery unit at the Fairmont Makkah Clock Royal Tower features an LCD TV and a spacious en-suite bathroom with a bathtub. The rooms also benefit from views of the Holy Ka''aba, the Haram or the Holy City.\r\n\r\nMakkah Royal Tower Fairmont boasts 9 state-of-the-art dining venues, including the Indian-inspired Bharat, the Lebanese lounge Al Dar, and the Al Dira rooftop restaurant. The hotel also offers an extensive 24-hour room service menu.\r\n\r\nGuests can enjoy a secretarial service, meeting rooms with a pre-function area, and a extra spacious ballroom for meetings and events. A media room with live broadcast capabilities is also available.', 'يقع هذا الفندق الفاخر الذي يتألف من 76 طابق على بعد 100 متر فقط من المسجد الحرام، وداخل برج ساعة مكة المكرمة،', 'Situated only 100 m from Masjid al-Haram,', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(62, 1, 5, 72, 74, 'فندق الصفوة رويال اوركيد', 'Al Safwah Royale Orchid Hotel ', 's_261330_الصفوة_رويال_اوركيد.jpg', 'يع فندق الصفوة قبالة بوابة الملك عبد العزيز في مكة المكرمة، ويقدم أماكن إقامة حديثة وراقية في مبنى عالي في ساحة الحرم المكّي. ويوفر خدمة الواي فاي المجانية.\r\n\r\nتم تزويد الغرف في فندق الصفوة رويال اوركيد بالأثاث المعاصر، وتم تجهيزها بشاشة تلفزيون مسطحة مع قنوات فضائية، وجميعها مكيفة الهواء وتحتوي على حمّام داخلي مزود بلوازم استحمام مختارة.\r\n\r\nيمكن للنزلاء الاستمتاع بالمأكولات السعودية التقليدية والأطباق العالمية الكلاسيكية التي يقدمها لهم مطعم الفندق. كما يمكن طلب الطعام والشراب عن طريق خدمة الغرف.\r\n\r\nيحتوي الصفوة رويال اوركيد أيضاً على مركز لرجال الأعمال في الموقع، إضافة إلى موظفي مكتب الاستقبال المتواجدين على مدار 24 ساعة', 'Facing Mecca’s King Abdulaziz Gate, Al Safwah offers modern accommodations in a high rise, located at Al Haram Al Makky Yard. It features free Wi-Fi access.\r\n\r\nFitted with contemporary furnishings, rooms at Al Safwah Royale Orchid Hotel come with flat-screen satellite TVs. They are all air conditioned and include private bathrooms with selected toiletries.\r\n\r\nGuests will enjoy a menu of traditional Saudi specialties and international classic dishes at the hotel''s restaurant. Food and drink room service is also available.\r\n\r\nOther amenities of the Royale Orchid Hotel include an on-site business center and 24-hour front desk staff', 'يقع فندق الصفوة قبالة بوابة الملك عبد العزيز في مكة المكرمة', 'Facing Mecca’s King Abdulaziz Gate', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-03-29 14:45:41'),
(63, 1, 5, 72, 75, 'دار التقوى', 'Dar Al Taqwa Hotel ', 's_467171_دار_التقوى.jpg', 'يتميز هذا الفندق بغرف مكيفة مع تلفزيون بشاشة مسطحة وحديقة الشاي التي تقدم الوجبات الخفيفة والحلويات، كما يقع على بعد أقل من دقيقتين سيراً على الأقدام من المسجد النبوي الشريف، ويمكن للضيوف الاستمتاع بخدمة الواي فاي المجانية في جميع الغرف.\r\n\r\nتم تصميم الغرف في دار التقوى بألوان هادئة وتتميز بنوافذ كبيرة وتوفر بعضها إطلالة على المسجد النبوي، وتضم كل غرفة تلفزيون بقنوات فضائية وميني بار مجهز جيداً بعناصر مجانية.\r\n\r\nيقدم مطعم المروة المأكولات المحلية والعالمية في أجواء أنيقة غير رسمية، ويمكن للضيوف الاسترخاء في اللوبي الذي يتميز بكراسي بذراعين فاخرة وتلفزيون بشاشة مسطحة.\r\n\r\nيبعد فندق دار التقوى مسافة 15 دقيقة بالسيارة من مطار المدينة المنورة، كما تبعد بوابة الملك فهد خطوات قليلة فقط، بينما تقع البوابة الرئيسية للسيدات قبالة الفندق. ', 'This hotel features air-conditioned rooms with a flat-screen TV and a tea garden serving light snacks and desserts. It is less than a 2-minute walk from the Holy Prophet Masjid. Guests can enjoy free WiFi in all the rooms.\r\n\r\nDar Al Taqwa’s rooms are decorated in soft colours and feature large windows, some of which overlook the Prohpet Masjid. Each room has satellite TV and a well-stocked minibar with free items.', ' يقع على بعد أقل من دقيقتين سيراً على الأقدام من المسجد النبوي الشريف، ', 'This hotel features air-conditioned rooms', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 13:02:03'),
(64, 1, 5, 72, 75, 'دار الهجرة إنتركونتيننتال ', 'Dar Al Hijra InterContinental ', 's_641175_دار_الهجرة.jpg', 'يتميز هذا الفندق المصنف 5 نجوم بموقع ممتاز في وسط المدينة المنورة، ويضم مطعم يقدم المأكولات الآسيوية والعالمية، ويبعد هذا الفندق مسافة 400 متر من حرم المسجد النبوي.\r\n\r\nيوفر دار الهجرة إنتركونتيننتال للضيوف غرف واسعة تضم ديكور على الطراز الكلاسيكي، وتتميز بعض الغرف بإطلالات على جبل أحد، كما تحتوي كل غرفة على حمام رخامي يضم مستلزمات استحمام فاخرة.', 'This 5-star hotel features a prime location in central Madina and has a restaurant that serves Asian and International cuisine. Prophet Muhammed''s Holy Mosque is 300 m away.\r\n\r\nDar Al Hijra InterContinental offers guests spacious accommodation decorated in a classical style. Some rooms feature views of Ohud Mountain. Each room has a marble bathroom with luxury bathroom amenities.', 'يتميز هذا الفندق المصنف 5 نجوم بموقع ممتاز في وسط المدينة المنورة', 'This 5-star hotel features a prime location in central Madina', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 13:20:36'),
(65, 1, 5, 72, 75, 'دار الإيمان إنتركونتيننتال ', 'Dar Al Iman InterContinental', 's_430059_دار_الايمان.jpg', 'يتميز دار الإيمان إنتركونتيننتال بموقع مثالي بجوار ساحة المسجد النبوي الشريف ويوفر غرف مع تكييف الهواء وتلفزيون مع قنوات فضائية، وتقع مكتبة الملك عبد العزيز العامة على بعد 10 دقائق فقط سيراً على الأقدام.\r\n\r\nتم تجهيز جميع الغرف في دار الإيمان إنتركونتيننتال بميني بارات وخزنات وحمامات خاصة، وتوفر بعض الغرف إطلالات على المسجد النبوي الشريف، ويمكن للضيوف الاستفادة من مكتب الاستقبال المريح الذي يعمل على مدار 24 ساعة وخدمة غسيل الملابس.\r\n\r\nيقدم مطعم Rotana مجموعة متنوعة من المأكولات العربية والعالمية.\r\n\r\nيقع الفندق على بعد 30 دقيقة فقط بالسيارة من مطار الأمير محمد بن عبد العزيز في المدينة المنورة، ويقع طيبة مول وسوبر ماركت بن داوود بجوار دار الإيمان إنتركونتيننتال. ', 'Ideally located adjacent to the Holy Prophet''s Mosque plaza, Dar Al Iman InterContinental offers rooms with air conditioning and satellite TV. The King Abdulaziz Library is only a 10-minute walk.\r\n\r\nAll rooms of InterContinental Dar Al Iman are equipped with minibars, safes and private bathrooms. Some rooms have views of the Holy Mosque of the Prophet Muhammad. Guests can benefit from the convenient 24-hour reception and a laundry service.', 'يتميز دار الإيمان إنتركونتيننتال بموقع مثالي بجوار ساحة المسجد النبوي الشريف', 'Ideally located adjacent to the Holy Prophet''s Mosque plaza', '', '', -1, 2, 8, '0', '0', 0, 1, '2017-04-01 13:33:44'),
(66, 1, 5, 72, 75, 'فندق أوبروى ', 'The Oberoi Hotel ', 's_618280_اوبروى.jpg', 'يتمتع فندق Oberoi بموقع مثالي على مقربة من المسجد النبوي والأماكن المقدسة الأخرى في المدينة المنورة، ويوفر أماكن إقامة تتميز بديكور أنيق. كما يحتوي على جيم وسبا ومجمع تجاري يضم محلات تجارية ذات علامات تجارية شهيرة.\r\n\r\nتوفر جميع الغرف والأجنحة في فندق Oberoi إطلالات على المدينة أو المسجد النبوي، ويحتوي كل جناح على غرفة معيشة مع تلفزيون بشاشة مسطحة وميني بار، فيما تحتوي بعض الأجنحة على منطقة تناول طعام منفصلة. وتشتمل بعض الحمامات على إكسسوارات مطلية بالذهب.\r\n\r\nيتميز مطعم الأندلس بتصميم إسلامي، ويقدم مأكولات التندوري الهندية ومأكولات عربية، فيما يقدم مطعم الزهراء مجموعة متنوعة من الشاي والوجبات الخفيفة وسط إطلالة جميلة على المسجد النبوي. وتتوفر خدمة الغرف على مدار الساعة.', 'In an ideal location in close proximity to the Prophet’s Mosque and Madina’s other sacred places, the Oberoi Hotel features elegantly decorated accommodations. It includes a gym, a spa and a retail arcade with brand name shops.\r\n\r\nAll the rooms and suites at Oberoi feature views of the city or the Prophet’s Mosque. Each suite includes a living room with a flat-screen TV and a minibar, while some include a separate dining area. Some bathrooms have gold-plated fittings.\r\n\r\nFeaturing an Islamic design, Al Andalous Restaurant serves Indian Tandoori and Arabic Cuisine, while Al Zahra serves a variety of tea and snacks with a beautiful view of the Prophet’s Mosque. Room service is available 24 hours.', 'يتمتع فندق Oberoi بموقع مثالي على مقربة من المسجد النبوي والأماكن المقدسة الأخرى في المدينة المنورة', 'In an ideal location in close proximity to the Prophet’s Mosque and Madina’s other sacred places', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 13:43:42'),
(67, 1, 5, 72, 75, 'شذا المدينة ', 'Shaza Al Madina', 's_26186_شذااااا.jpg', 'يقع هذا الفندق البوتيكي المزين بأناقة على أعتاب باب المسجد النبوي الشريف في المدينة المنورة، ويتميز بإشعاعه الروحاني والتطور. وتتضمن خيارات تناول الطعام في شذا مطبخ استعراضي مفتوح يقدم الأطباق المبتكرة.\r\n\r\nتتميز التصميمات الداخلية المريحة في فندق شذا المدينة بإضاءة ملونة باستخدام الفوانيس المصرية المصممة خصيصاً. وتم تزيين جدران الفندق بواسطة ثريا ساندرز الشهيرة بتصاميمها العربية التقليدية. وتتضمن جميع الغرف تليفزيون بشاشة مسطحة وميني بار وحمام داخلي.\r\n\r\nيمكن تذوق الأطباق المبتكرة والطازجة في صالة شاليمار. ويمكن للنزلاء زيارة مطعم أرابيسك للتمتع بمزيج فريد من المأكولات العربية وأطباق شمال إفريقيا وجنوب شرق آسيا.\r\n\r\nغرف فندق شذا المدينة أنيقة وتخلق أجواء هادئة. وتوفر كل غرفة البونبون محلي الصنع ومجموعة شاي تركي خاصة.\r\n\r\nيقع فندق شذا المدينة على بعد 13 كم من مطار الأمير محمد. وتتوفر مواقف خاصة مجانية للسيارات في الموقع، وتخضع للتوافر. ', 'On the doorsteps of the Prophet''s Mosque in Medina, this richly decorated design hotel radiates spirituality and sophistication. Shaza’s 2 dining options include an open show kitchen, which serves fusion cuisine.\r\n\r\nShaza Al Madina’s intimate interiors are filled with mood lighting, created by specially designed Egyptian lanterns. The hotel’s walls were decorated by Soraya Sanders, famous for her traditional Arabic designs. All rooms include a flat-screen TV, a minibar and an en-suite bathhroom.\r\n\r\nFresh and creative cuisine can be tasted at the Shalimar lounge. For a unique blend of North African, Arabian and South-East Asian delights, guests are welcome to visit the airy Arabesque Restaurant.', 'يقع هذا الفندق البوتيكي المزين بأناقة على أعتاب باب المسجد النبوي الشريف في المدينة المنورة', 'On the doorsteps of the Prophet''s Mosque in Medina', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 14:02:45'),
(68, 1, 5, 72, 75, 'هوليداي فيلا', 'Holiday Villa', 's_32265_هوليداى.jpg', 'يوفر فندق هوليداي فيلا المدينة المنورة أجواء إقامة هادئة في مدينة المدينة المنورة. كما يقدم هذا الفندق للضيوف خدمة الغرف 24-ساعة، بار قهوة وطابق المدراء. \r\n\r\nيوفر هذا الفندق والمصنف 5 نجوم أمن، خدمة غسل وكي الملابس وصرف العملات. يتواجد طاقم محترف للإهتمام بالزبائن على مدار الساعة. \r\n\r\nتتضمن غرف الفندق حذاء قماشي داخلي، محطة أي-بود ( i-pod) وبار صغير. كل غرفة تشمل حمام خاص فيه مجفف شعر وأثواب حمام. \r\n\r\nتقدم مطاعم فندق هوليداي فيلا المدينة المنورة، منها مطعم Delifrabia ومطعم Cempaka وجبة العشاء للنزلاء في كل ليلة. من أجل النزلاء الذين يقضون كامل اليوم خارجاً، يوفر الفندق وجبات غداء سفرية حسب الطلب. \r\n\r\nيسهل الوصول من فندق هوليداي فيلا المدينة المنورة إلى المسجد النبوي. يبعد الفندق مسافة قصيرة سيراً على الأقدام من البقيع.', 'Holiday Villa Medina offers a tranquil setting in Madinah. This hotel also offers 24-hour room service, a coffee bar and executive floor.', 'يوفر فندق هوليداي فيلا المدينة المنورة أجواء إقامة هادئة في مدينة المدينة المنورة.', 'Holiday Villa Medina offers a tranquil setting in Madinah.', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-04-01 14:18:58'),
(70, 1, 4, 72, 75, ' جوار السقيفة', 'Jewar Al Saqefah Hotel ', 's_909666_جوار_السقيفه.jpg', 'يقع فندق جوار السقيفة في المدينة المنورة، ويوفر أماكن إقامة عصرية. كما يضم خدمة الواي فاي المجانية في جميع المناطق، ويبعد مسافة دقيقتين سيراً على الأقدام عن الحرم الشريف.\r\n\r\nتم تجهيز جميع الغرف بأرضيات من السجاد. وتضم كل غرفة جهاز تلفزيون بشاشة مسطحة وغلاية كهربائية وميني بار. كما تحتوي الحمامات الخاصة على دش ومجفف الشعر ولوازم استحمام مجانية.\r\n\r\nيقع مكان الإقامة على بعد 2.9 كم من النور مول، ويمكنكم الوصول إلى مطار المدينة المنورة في 25 دقيقة بالسيارة. ', 'n Medina, Jewar Al Saqefah Hotel has modern accommodations. It features free Wi-Fi in all areas and Al Haram is 2-minute walk away.\r\n\r\nAll rooms are fitted with carpeted floors. Each one includes a flat-screen TV, an electric kettle and a minibar. Featuring a shower, the private bathrooms also have a hairdryer and free toiletries.\r\n\r\nThe property is around 3.2 km from Al Noor Mall and Al Madinah Airport is 25 minutes away by car. ', 'يقع فندق جوار السقيفة في المدينة المنورة، ويوفر أماكن إقامة عصرية.', 'In Medina, Jewar Al Saqefah Hotel has modern accommodations.', '', '', 0, 2, 10, '39.6068531', '24.4719523', 0, 1, '2017-04-01 14:40:52'),
(71, 1, 5, 72, 75, 'فندق المدينة هيلتون', 'Madinah Hilton Hotel', 's_544254_هيلتون_المدينه.jpg', 'يقع فندق Madinah Hilton على بعد مسافة سير قصيرة من المسجد النبوي، في قلب حي التسوق بالمدينة المنورة. ويقدم الفندق غرفاً مريحة مع تليفزيون مع القنوات الفضائية.\r\n\r\nجميع الغرف مكيفة الهواء، ويحتوي البعض على منطقة جلوس. تم تزويد أماكن الإقامة بمكتب للعمل وميني بار.\r\n\r\nيضم فندق Madinah Hilton مجموعة من المتاجر بالطابق الأرضي. كما يوفر الفندق مكتب استقبال يعمل على مدار 24 ساعة ومركز لرجال الأعمال ومكتب جولات سياحية.\r\n\r\nيمكن للضيوف الاستمتاع بتناول وجبة شهية من الطعام العربي التقليدي في مطعم فندق Madinah بينما يطلّون على المسجد النبوي. يقدم فندق Madinah Hilton خدمة الغرف كذلك.\r\n\r\nيبعد مطار الأمير محمد نحو 25 دقيقة بالسيارة. ', 'The Madinah Hilton Hotel is located only a short walk from the Holy Mosque, right in the heart of Madinah''s shopping district. It offers rooms with satellite TV.\r\n\r\nEach room is air conditioned and some have a sitting area. A work desk and a minibar are equipped in all accommodations.\r\n\r\nMadinah Hilton Hotel has a range of stores on the first floor. The hotel also provides a 24-hour front desk, a business center and a tour desk.\r\n\r\nGuests can enjoy a meal of traditional Arabian delicacies in the hotel’s Madinah Restaurant while admiring the view of the Holy Mosque. Madinah Hilton offers room service as well.\r\n\r\nPrince Mohammed Airport is 25 minute drive away. ', 'يقع فندق Madinah Hilton على بعد مسافة سير قصيرة من المسجد النبوي، في قلب حي التسوق بالمدينة المنورة. ', 'The Madinah Hilton Hotel is located only a short walk from the Holy Mosque, ', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 14:55:03'),
(72, 1, 5, 72, 75, ' لـــيدر المنى كريم ', 'LEADER Al Muna Kareem Hotel ', 's_799732_المنى_كريم.jpg', 'يوفر LEADER Al Muna Kareem Hotel ذو الـ 16 طابق على إقامة أنيقة من فئة 5 نجوم في وسط المدينة. يبعد 70 متراً عن المسجد النبوي ويقدم الواي فاي مجاناً.\r\n\r\nتأتي الغرف في LEADER Al Muna Kareem Hotel بديكور وأثاث مفعم بالألوان. وقد تم تجهيز كل غرفة بمكتب عمل، وتليفزيون متصل بالقنوات الفضائية وأدوات الحمام.\r\n\r\nيمكن للضيوف في الصباح الاستمتاع بتناول بوفيه الإفطار الغني الذي تم إعداده من المكونات المحلية الطازجة. كما يقدم الطعم العصري القائمة الانتقائية التي تتألف من الأطباق المحلية وكذلك الأطباق الدولية لتناول طعام الغداء والعشاء.\r\n\r\nيشمل LEADER Al Muna Kareem Hotel على مكتب استقبال على مدار 24 ساعة ومواقف سيارات في الموقع مجانا. المناطق التجارية ومناطق رجال الأعمال في المدينة المنورة تقع أيضاً على مسافة قريبة من الفندق. ', 'The 16-floor LEADER Al Muna Kareem Hotel offers elegant 5-star accommodation in the centre of Madinah. It is just 70 m from the Prophet’s Mosque and offers free WiFi.\r\n\r\nThe rooms at LEADER Al Muna Kareem Hotel have rich-coloured décor and furnishings. Each room is equipped with a work desk, satellite TV and bathroom toiletries.\r\n\r\nIn the mornings, guests can enjoy a rich buffet breakfast prepared with seasonal ingredients. The trendy restaurant also offers an à la carte menu consisting of local dishes as well as international specialities for lunch and dinner.\r\n\r\nLEADER Al Muna Kareem Hotel has a 24-hour front desk and free onsite parking. The commercial and business districts of Medina are within walking distance of the hotel. ', ' لـــيدر المنى كريم  ذو الـ 16 طابق  فئة 5 نجوم في وسط المدينة. يبعد 70 متراً عن المسجد النبوي', 'The 16-floor LEADER Al Muna Kareem Hotel offers elegant 5-star accommodation in the centre of Madinah', '', '', 0, 2, 9, '0', '0', 0, 1, '2017-04-01 15:06:27'),
(73, 1, 4, 72, 75, 'فندق الإيمان رويال', 'Al Eiman Royal Hotel', 's_367836_الايمان_رويال.jpg', 'يقع فندق الإيمان رويال في الجزء الشمالي من المنطقة المركزية للمدينة المنورة على بعد 100 متر من المسجد النبوي. وتوفر بعض الغرف إطلالات على جبل أُحد أو المسجد.\r\n\r\nتتميز جميع أماكن الإقامة المكيفة في الإيمان رويال بديكور عصري مع أرضيات مفروشة بالسجاد. وتوفر كل غرفة خزانة للملابس وميني بار وحمام خاص.\r\n\r\nيمكن للنزلاء تناول الطعام في مطعم أُحد الذي يقدم مجموعة متنوعة من الأطباق الآسيوية، أو التمتع بالأطباق العالمية في مطعم بدر. ويضم الطابق الأرضي مقهى يقدم المشروبات والسندوتشات.\r\n\r\nيقع متحف الحجاز للسكك الحديدية على بعد 10 دقائق بالسيارة من فندق الإيمان رويال. بينما يقع مطار الأمير محمد بن عبد العزيز الدولي على مسافة 20 دقيقة بالسيارة. وتتوفر مواقف مجانية للسيارات في مكان الإقامة (تخضع للتوافر). ', 'Located in the northern part of the central area in Al Madinah, Al Eman Royal Hotel is within 100 m from the Prophet’s Mosque. Some of its rooms have views of Mount Uhud or the mosque.\r\n\r\nAll air-conditioned accommodation at Al Eman Royal feature a modern décor with carpeted floors. Each room comes with a wardrobe, a minibar and a private bathroom.\r\n\r\nYou can dine at Uhud Restaurant which offers a variety of Asian cuisine dishes, or enjoy an international cuisine at Bader Restaurant. The ground floor includes a coffee shop that serves beverages and sandwiches.\r\n\r\nThe Hejaz Railway Museum is a 10-minute drive from Al Eman Royal Hotel. Prince Mohammad Bin Abdulaziz International Airport is 20 minutes away by car. Free parking is available at the property subject to availability. ', 'يقع فندق الإيمان رويال في الجزء الشمالي من المنطقة المركزية للمدينة المنورة على بعد 100 متر من المسجد النبوي.', 'Located in the northern part of the central area in Al Madinah, Al Eman Royal Hotel is within 100 m from the Prophet’s Mosque', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 15:17:29'),
(74, 1, 5, 72, 75, 'فندق ميلينيوم العقيق المدينة', 'Millennium Al Aqeeq Madinah Hotel', 's_725022_ميلينيوم_العقيق.jpg', 'يقع فندق ميلينيوم العقيق المدينة في المدينة المنورة على بعد خطوات قليلة فقط من الحرم النبوي الشريف، ويمكن للضيوف الاستمتاع بخدمة الواي فاي مجاناً في كافة أنحاء مكان الإقامة.\r\n\r\nتحتوي الغرف على جهاز تلفزيون بشاشة مسطحة مع قنوات فضائية ونظام تكييف وميني بار، كما توفر الحمامات الخاصة دش ومجفف للشعر ولوازم استحمام مجانية، كما تضم الأجنحة غرفة معيشة، وتتوفر خدمة الغرف على مدار 24 ساعة.\r\n\r\nيضم فندق ميلينيوم العقيق المدينة مكتب استقبال يعمل على مدار 24 ساعة وسوق صغير في الموقع، وتشمل المرافق الأخرى المتوفرة مطعمين ومقهى ومتاجر (في الموقع).\r\n\r\nيقع الفندق على بعد 3 كم من النور مول وعلى بعد 3.2 كم من المدينة مول، كما يوفر مكان الإقامة هذا مواقف مجانية للسيارات في الموقع وتكون رهناً بالتوافر. ', 'Millennium Al Aqeeq Madinah Hotel is located in Medina, just a few steps from the holy Haram. Guests can enjoy free WiFi throughout the property.\r\n\r\nRooms here will provide you with a flat-screen satellite TV, air conditioning and a minibar. Featuring a shower, private bathrooms also come with a hairdryer and free toiletries. Suites have a living room. Room service is available 24 hours.\r\n\r\nAt Millennium Al Aqeeq Madinah Hotel you will find a 24-hour front desk and a mini-market on site. Other facilities offered include 2 restaurants, a coffee shop and shops (on site).\r\n\r\nThe hotel is 3 km from Al Noor Mall and 3.2 km from Madina Mall. The property offers free on-site parking upon availability. ', 'يقع فندق ميلينيوم العقيق المدينة في المدينة المنورة على بعد خطوات قليلة فقط من الحرم النبوي الشريف،', 'Millennium Al Aqeeq Madinah Hotel is located in Medina, just a few steps from the holy Haram', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 15:33:08'),
(75, 1, 5, 72, 75, 'بولمان زمزم المدينة ', 'Pullman Zamzam Madina', 's_351566_زمزم_المدينه.jpg', 'يقع بولمان زمزم المدينة في المدينة المقدسة في المدينة المنورة وعلى بعد 150 متر فقط من باب السلام من المسجد النبوي ويوفر خدمة الواي فاي مجاناً في جميع أنحاء الفندق بأكمله.\r\n\r\nتمزج جميع الغرف والأجنحة والتي يبلغ عددها 835 بين الحداثة العربية والأناقة الفرنسية، وتتميز جميعها بأنها مكيفة وتوفر خدمة الواي فاي مجاناً وجهاز تلفزيون بشاشة مسطحة ومرافق صنع الشاي/القهوة، وتحتوي بعض الغرف على منطقة جلوس وسرير أريكة، كما تشمل الحمامات على دش.\r\n\r\nيضم مكان الإقامة 4 مطاعم فريدة مثل Acacia الذي يقدم المأكولات العالمية للإفطار والغداء والعشاء طوال اليوم، كما يتميز Al Mandara بتقديم قائمة مأكولات ومأكولات شرقية تخصصية على وجبة الغداء أو العشاء.\r\n\r\nيبعد مسجد قباء وجبل أحد مسافة 15 دقيقة فقط من مكان الإقامة، وتتوفر مواقف داخلية مجانية للسيارات في الموقع. ', 'Located in the holy city of Madinah Al Munawara and only 150 m from Bab Al Salam of Al Masjid Al Nabawi, Pullman Zamzam Madina offers free WiFi throughout the entire hotel.\r\n\r\nAll 835 rooms & suites are blended with modern Arabic & French elegance, All rooms are air-conditioned and feature free WiFi, a flat-screen TV and tea/coffee making facilities. Some rooms offer a seating area and sofa bed. The bathrooms are fitted with a shower.\r\n\r\nThe property has 4 unique restaurants such as Acacia, which serves an all-day-dining International cusine for breakfast, lunch and dinner. Al Mandara features an a la carte menu and oriental specialties during lunch or dinner.\r\n\r\nQuba Mosque and Uhud Mountain are only 15-minutes away from the property. Free indoor parking is available on site. ', 'يقع بولمان زمزم المدينة في المدينة المقدسة في المدينة المنورة وعلى بعد 150 متر فقط من باب السلام من المسجد النبوي', 'Located in the holy city of Madinah Al Munawara and only 150 m from Bab Al Salam of Al Masjid Al Nabaw', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 15:45:08'),
(76, 1, 4, 72, 75, 'رامادا المدينة الحمراء', 'Ramada Madinah Al Hamra', 's_91585_رامادا_الحمرا.jpg', 'وفر هذا الفندق غرفًا مُزودة بتلفزيون بشاشة مسطحة، ومواقف مجانية عامة للسيارات ويضم مكتب استقبال يعمل على مدار الساعة. ويقع على بعد 300 متر من المسجد النبوي الشريف.\r\n\r\nتحتوي الغرف المكيفة في فندق رامادا المدينة الحمراء على كراسي بذراعين وتلفزيون مع قنوات متعددة اللغات في منطقة الجلوس. وتضم جميع الغرف حمامات خاصة.\r\n\r\nيُمكن للضيوف تحويل العملات أو طلب خدمات غسيل الملابس في مكتب الاستقبال الذي يعمل على مدار الساعة بفندق رامادا. ويوفر الفندق أيضًا الصحف المحلية والقومية في اللوبي.\r\n\r\nيقع فندق رامادا المدينة الحمراء على بعد 10 دقائق بالسيارة من مطار الأمير محمد بن عبد العزيز. ', 'This hotel offers rooms with a flat-screen TV, a 24-hour front desk and free public parking. It is located 300 m away from Holy Mosque of Prophet Mohammed.\r\n\r\nRamada Madinah Al Hamra’s rooms are air-conditioned and have comfortable armchairs and TV with multilingual channels in the seating area. All rooms have a private bathroom.\r\n\r\nAt Ramada’s 24-hour front desk, guests can exchange currency or request laundry services. The hotel also has local and national newspapers in the lobby.\r\n\r\nRamada Madinah Al Hamra is a 10-minute drive from Prince Mohammad Bin Abdulaziz Airport. ', 'يوفر هذا الفندق غرفًا مُزودة بتلفزيون بشاشة مسطحة،', 'This hotel offers rooms with a flat-screen TV', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-01 15:56:21'),
(77, 1, 4, 72, 74, 'رمادا دار الفائزين', 'Ramada Dar Al Fayzeen ', 's_669708_29141042.jpg', 'يقع فندق رمادا دار الفائزين في مدينة مكة المكرمة على بعد 5 دقائق سيرا على الأقدام من الحرم.\r\n ويوفر خدمة الواي فاي المجانية في المناطق العامة ويضم مطعمًا يُقدم بوفيه الإفطار.\r\n\r\nتم تزيين جميع الغرف في رامادا دار الفائزين بألوان دافئة. وتشتمل جميعها على منطقة صغيرة للجلوس مزودة بتلفزيون بشاشة مسطحة وميني بار، تشمل المرافق خزانة ملابس، وغلاية كهربائية وهاتف.\r\n\r\nيمكن للضيوف التسوق في أوركيد الصفوة الذي يبعد مسافة 10 دقائق بالسيارة. فيما يقع مطار الملك عبد العزيز الدولي على بعد 60 دقيقة بالسيارة، وتتوفر مواقف عامة للسيارات مجانًا في المنطقة المجاورة. \r\n\r\nالمسفلة هو خيار رائع للمسافرين المهتمين بـالمعالم القديمة وزيارة معالم المدينة والتاريخ.', 'Located in Mecca, Ramada Dar Al Faazin is a 5-minute walk from the Haram. It offers free Wi-Fi in public areas and a restaurant serving buffet breakfast.\r\n\r\nAll rooms at Ramada Dar Al Fayzeen are decorated with warm colors. They all include a small seating area with a flat-screen TV and a minibar. Facilities include a walk-in wardrobe, an electric kettle and a telephone.\r\n\r\nGuests can shop at Orchid Al Safwa, a 10-minute drive away. King Abdulaziz International Airport is a 60-minute drive away, and free public parking is available in the vicinity.\r\n\r\nEl masfala is a great choice for travellers interested in ancient landmarks and visiting the city and history.', 'يوفر هذا الفندق غرفًا مُزودة بتلفزيون بشاشة مسطحة،', 'This hotel offers rooms with a flat-screen TV', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-04-02 09:50:07'),
(78, 1, 4, 72, 74, 'روضة البيت أجياد', 'Rawdat Albait ajyad', 's_476913_82730786.jpg', 'يقع فندق روضة البيت اجياد في مكة المكرمة على بُعد 1.2 كم من أبراج البيت، ويوفر خدمة الواي فاي مجانًا في جميع المناطق.\r\n\r\nتحتوي الغرف على تلفزيون بشاشة مسطحة، وتشمل بعض الغرف منطقة جلوس حيث يمكن للضيوف الاسترخاء فيها، وستجدون غلاية في الغرفة، وتحتوي الغرف على حمام خاص مُزود بحوض استحمام أو دش، وتشتمل المزايا الإضافية على أردية حمام ونعال ولوازم استحمام مجانية.\r\n\r\nيوفر مكان الإقامة خدمة نقل مجانية ذهابًا وإيابًا.\r\n\r\nيقع فندق روضة البيت اجياد على بُعد 1.3 كم من يرج الصفوة، كما يقع على بُعد 1.6 كم من المسجد الحرام، ويبعُد مسافة 74 كم عن أقرب مطار، وهو مطار الطائف الإقليمي. \r\n\r\nصُنف مكان الإقامة هذا على أنه الأفضل قيمة في مكة المكرمة! فالضيوف هنا يحصلون على مزايا أكثر مقابل ما يدفعوه بالمقارنة مع أماكن إقامة أخرى في المدينة.', 'ocated in Makkah, 1.2 km from Abraj Al Bait Towers, Rawdat Albait ajyad Hotel offers free Wi-Fi in all areas.\r\n\r\nThe rooms have a flat-screen TV. Some rooms include a seating area where guests can relax. You will find an in-room kettle and the rooms have a private bathroom with bath or shower. Additional benefits include bathrobes, slippers and complimentary toiletries.\r\n\r\nThe accommodation provides a free round-trip shuttle service.\r\n\r\nLocated 1.3 km from Jalal Al Safwa, Rawdat Albait ajyad is 1 km from the Grand Mosque and is 74 km from the nearest airport, Taif Regional Airport.\r\n\r\nRate this place of residence as the best value in Mecca! Guests here receive more benefits than they pay for other accommodation in the city', '.أحد أفضل خياراتنا في مكة المكرمة', 'One of our best choices in Mecca.', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-04-02 10:05:00'),
(79, 1, 4, 72, 75, 'روضة العقيق', 'Rowdat el akek', 's_934911_82009981.jpg', 'يوفر روضة العقيق مكان إقامة في المدينة المنورة، ويمكن للضيوف الاستمتاع بالمطعم المتوفر في الموقع.\r\n\r\nتتميز جميع الغرف في هذا الفندق بأنها مكيفة بالهواء وتوفر تلفزيون بشاشة مسطحة، وتتوفر غلاية في الغرفة.\r\n\r\nيتوفر في مكان الإقامة مكتب استقبال يعمل على مدار الساعة، وتتوفر خدمة غسيل الملابس مقابل تكلفة إضافية.\r\n\r\nيقع المسجد النبوي على بعد 600 متر من روضة العقيق، بينما يقع البازار القديم على بعد 800 متر من مكان الإقامة، ويقع مطار الأمير محمد بن عبد العزيز الدولي على بعد 14 كم من مكان الإقامة. \r\n\r\nهذه المنطقة المفضلة من المدينة المنورة لدى ضيوفنا بناءً على التقييمات المستقلة.\r\n\r\nصُنف مكان الإقامة هذا على أنه الأفضل قيمة في المدينة المنورة! فالضيوف هنا يحصلون على مزايا أكثر مقابل ما يدفعوه بالمقارنة مع أماكن إقامة أخرى في المدينة.', 'Rowdat el akek offers accommodation in Madina, and guests can enjoy the on-site restaurant.\r\n\r\nAll rooms at this air-conditioned hotel feature a flat-screen TV and a kettle is available in the room.\r\n\r\nThere is a 24-hour front desk and laundry service is available at an additional cost.\r\n\r\nThe Prophet''s Mosque is located 600 meters from the Agadir kindergarten, while the old bazaar is 800 meters from the residence. Prince Mohammed bin Abdulaziz International Airport is 14 km from the residence.\r\n\r\nThis is the preferred area of ​​Madina to our guests based on independent assessments.\r\n\r\nI rated this place of residence as the best value in Madina Guests here receive more benefits than they pay for other accommodation in the city', 'أحد أكثر أماكن الإقامة مبيعاً لدينا في المدينة المنورة', 'One of our best-selling accommodation in Madina', '', '', 0, 2, 8, '0', '0', 0, 1, '2017-04-02 11:36:11'),
(81, 1, 5, 72, 74, 'الشهداء', 'Shohada Hotel', 's_752931_61491609.jpg', 'يوفر فندق الشهداء غرف فاخرة مع تلفزيونات إل سي دي وتكييف، ويقع على بعد مسافة مشي قريبة من المسجد الحرام. كما تشمل المرافق مركز لرجال الأعمال.\r\n\r\nتم تجهيز جميع الغرف في فندق الشهداء بتلفزيون مع القنوات الفضائية ومكتب مع إضاءة جيدة. كما تحتوي كل غرفة أيضاً على حمام رخامي خاص.\r\n\r\nيمكن للضيوف من الذكور الاستمتاع بتدليك القدمين بواسطة مدلكين عالميين.\r\n\r\nيقدم مطعم فندق الشهداء، Caravan Stop، مجموعة متنوعة من أطباق المطبخ المحلي والعالمي سواء لطعام الإفطار أو الغداء أو العشاء. كما يوفر المخبز تشكيلة واسعة من الخبز والمعجنات الطازجة.\r\n\r\nيقع الفندق على مسافة مشي قريبة من المسجد الحرام ويوفر أيضاً خدمة نقل ذهاباً وإياباً على مدار 24 ساعة بين الفندق والحرم. ', 'The Shuhada Hotel offers luxurious rooms with LCD TVs and air conditioning, within walking distance of the Grand Mosque. Facilities include a business center.\r\n\r\nAll rooms at Al Shuhada Hotel are equipped with satellite TV and a desk with good lighting. Each room also has a private marble bathroom.\r\n\r\nMale guests can enjoy foot massages with two massagers.\r\n\r\nThe restaurant at the Caravan Stop offers a variety of local and international cuisine both for breakfast, lunch and dinner. The bakery also offers a wide selection of bread and fresh pastries.\r\n\r\nThe hotel is within walking distance of the Grand Mosque and also offers a round-the-clock 24-hour shuttle service between the hotel and the Haram.', 'فندق يشمل مركز لرجال الأعمال', 'This hotel includes a business center', '', '', 0, 1, 11, '0', '0', 0, 1, '2017-04-02 17:08:41'),
(82, 1, 5, 72, 74, 'جراند مكة', 'Grand Makkah Hotel', 's_72604_67934434.jpg', 'يوفر فندق جراند مكة إطلالة مباشرة على مقبرة المعلاة وإطلالة واضحة على جبل النور (غار حراء)، ويبعد مسافة 10 دقائق سيراً على الأقدام من المسجد الحرام وهو الفندق الأقرب بَعد أداء العُمرة.\r\n\r\nتوفر جميع الغرف في هذا الفندق نظام تكييف وجهاز تلفزيون إل إي دي ذي شاشة مسطحة مع قنوات فضائية، وتشتمل بعض الوحدات على منطقة للجلوس حيث يمكن للضيوف الاسترخاء. كما تتوفر غلاية في الغرفة، وتحتوي كل غرفة على حمام خاص يشمل لوازم استحمام مجانية ومجفف للشعر لراحة الضيوف.\r\n\r\nيتوفر مكتب استقبال يعمل على مدار 24 ساعة يومياً ومكتب مناسك لمساعدتكم بخصوص الاستفسارات الدينية، بالإضافة إلى توفر مركز مخصص لخدمة الضيوف وتلبية جميع الاحتياجات أثناء فترة الإقامة. كما يمكن للضيوف الاستمتاع بمشاهدة الرياضة المفضلة لديهم في مقهى زمزم.\r\n\r\nيضم الفندق أيضاً مركز أعمال مجهز بالكامل ومركز رياضي، وتتوفر متاجر في الطابق الأرضي. كما يبعد الفندق مسافة 74 كم من مطار الطائف و90 كم من مطار الملك عبد العزيز بجدة. \r\n\r\n', 'Grand Makkah Hotel offers direct views of Al Maawla Tomb and clear views of Mount Al Noor (Gare Hira), a 10-minute walk from the Grand Mosque, the closest hotel after Umrah.\r\n\r\nAll rooms at this hotel offer air conditioning and a flat-screen LCD TV with satellite channels. Some units include a seating area where guests can relax. A kettle is available in the room, and each room has a private bathroom with free toiletries and a hairdryer for guests'' convenience.\r\n\r\nA 24-hour front desk and a concierge desk are available to assist you with religious inquiries, as well as a dedicated guest center and meeting all needs during your stay. Guests can enjoy watching their favorite sport at Zamzam Café.\r\n\r\nThe hotel also has a fully equipped business center and gym, and shops are available on the ground floor. The hotel is 74 km from Taif Airport and 90 km from King Abdul Aziz Airport in Jeddah.', 'تشعر وكأنك نجم واستمتع بالمعاملة والخدمات الراقية', 'Feel like a star and enjoy the ultimate treatment and services', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-04-02 17:20:51'),
(83, 1, 4, 72, 74, 'الندوة', 'Al Nadwa Hotel', 's_117595_20160111-001025-575.jpg', 'يقع فندق الندوة في مكة المكرمة، ويوفر مكان إقامة مفروش ببساطة. ويبعُد المسجد الحرام مسافة 5 دقائق بالسيارة.\r\nتحتوي جميع الغرف في مكان الإقامة على تلفزيون بشاشة مسطحة وتكييف. يتوفر هناك أيضا ثلاجة وخزانة ملابس. كما يشتمل الحمام الخاص على دُش. تشمل المزايا الإضافية صندوق ودائع آمن.\r\nيتوفر في فندق الندوة مكتب استقبال يعمل على مدار 24 ساعة. وتشمل المرافق الأخرى المتوفرة في مكان الإقامة خدمة تخزين الأمتعة ومحلات تجارية (في الموقع).الإنترنت متوفر يبعد 100 متر عن الحرم\r\nيقع الفندق على بعد كيلومتر من برج ساعة مكة الملكية. كما يبعُد 75 كم عن مطار الملك عبد العزيز الدولي.يقع خلف فندق هيلتوم مكة على بعد 100 متر من الحرم المكي الشريف و مناسب لكبار السن وبه ممرات خاصة بذوي الاحتياجات الخاصة\r\nيتكون من 12 طابقا', 'The seminar hotel is located in Mecca and offers a simply furnished accommodation. The Grand Mosque is a 5-minute drive away.\r\nAll rooms have a flat-screen TV and air conditioning. There is also a refrigerator and a wardrobe. The private bathroom has a shower. Additional features include a safety deposit box.\r\nThe seminar hotel has a 24-hour front desk. Other on-site facilities include luggage storage and on-site shops. Internet is available 100 meters from the Haram\r\nThe hotel is located a kilometer from Mecca''s Royal Clock Tower. It is 75 km from King Abdul Aziz International Airport. Located behind the Hiltum Hotel Makkah, 100 meters from the Holy Haram, suitable for the elderly and with special needs corridors\r\nWith 12 rooms to choose from,', 'يوفر مكان إقامة مفروش ببساطة', 'It offers simply furnished accommodation', '', '', 0, 1, 8, '0', '0', 0, 1, '2017-04-02 17:39:15');
