(1, 'بورتو سخنه', '55', 1200, 2, 1, 142, 2, 's_251763_437388862.jpg', 0, '55', '55', 'هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأه', '55', 0, 0, 0, 0, 0, '0', '0', 97, 1, '2016-11-16 14:37:21'),
