(6, 'اجازة نصف العام', '', 900, 2, 1, 0, 0, '56345302.jpg', 0, '<p dir="RTL"><strong>الإقامة لمدة 4 أيام / 3 ليالي ( بالإفطار و العشاء) بفندق  Novotel SSH Palm</strong></p>\\r\\n\\r\\n<p dir="RTL"><strong>التمتع بكل مميزات المنتجع من (ملاعب و حمامات سباحة و شاطئ وخدمات اخري) مجانا </strong></p>\\r\\n', '', 'رحلة اجازة نصف العام', '', 0, 0, 0, 0, 0, '0', '0', 104, 1, '2016-11-16 14:37:21'),
(7, 'رحلة راس السنه', '', 1110, 2, 3, 0, 0, '65483824.jpg', 0, '<p dir="RTL"><strong>هذا العرض يشمل الاقامه بـ</strong></p>\\r\\n\\r\\n<p dir="RTL"><strong>( الافطار وغذاء وعشاء ومشروبات وسناكس)</strong></p>\\r\\n', '', 'رحلة راس السنة', '', 0, 0, 0, 0, 0, '0', '0', 104, 1, '2016-11-16 14:37:21'),
(8, 'رحلة الغردقة', '', 900, 2, 2, 13, 0, '56345302.jpg', 0, '<p>هذا البرنامج يشتمل اﻻفطار والعشاء</p>\r\n\r\n<p>\\r\\n</p>\r\n', '', 'رحلة الغردقه 5ايام 4 ليالى', '', 0, 0, 0, 0, 0, '0', '0', 104, 1, '2016-11-16 14:37:21'),
(9, 'الغردقة 4 ايام 3 ليالى', '', 1150, 2, 2, 8, 0, '8690955.jpg', 0, '<p>هذا البرنامج يشمل اﻻفطار والعشاء</p>\\r\\n', '', 'رحلة الغردقة 4 ايام 3 ليالى', '', 0, 0, 0, 0, 0, '0', '0', 104, 1, '2016-11-16 14:37:21'),
