(33, 'عمرة رجب و شعبان  الفاخرة', 'عمرة رجب و شعبان  الفاخرة', 16000, 2, 4, 108, 0, 's_275396_Hyatt-Regency-Makkah-P019-King-Bedroom-with-View_gallery-2-3-item-panel3.jpg', 9, 'انضم لعملاء ناشيونال ايجيبت للسياحه المميزون واحجز عمره رجب وشعبان\r\nخدمات لم يسبق لها مثيل في السوق المصري وتشمل:\r\n١-السفر من صاله كبار الزوار بمطار القاهره\r\n٢- إشراف ديني واداري مميز طوال الرحله\r\n٣- خدمه نقل الحقائب والوزن الجماعي للمجموعات\r\n٤- وجبات ساخنه وعصائر ومشروبات خلال جميع التنقلات الداخليه\r\n٥- الانتقالات الداخليه باتوبيسات حديثه مكيفه ٢٠١٧ مع وجود خدمه الواي فاي في الأتوبيسات\r\n٦- هدايا قيمه ومميزه لجميع المعتمرين\r\n٧- شرح كامل لمزارات المدينه بصحبه الإشراف الديني\r\n٨- مزارات مدينه جده ومولاتها قبل العوده بيوم للتسوق\r\n٩- خدمات كبار السن ومتحدي الإعاقة\r\nربما لا نكون الأرخص لكننا بالتاكيد افضل اختياراتك لاننا ............ نعرف_ماتستحق', 'انضم لعملاء ناشيونال ايجيبت للسياحه المميزون واحجز عمره رجب وشعبان\r\nخدمات لم يسبق لها مثيل في السوق المصري وتشمل:\r\n١-السفر من صاله كبار الزوار بمطار القاهره\r\n٢- إشراف ديني واداري مميز طوال الرحله\r\n٣- خدمه نقل الحقائب والوزن الجماعي للمجموعات\r\n٤- وجبات ساخ', 'افضل عروض عمرة رجب و شعبان', 'افضل عروض عمرة رجب و شعبان', 6, 10, 0, 0, 5, '0', '0', 0, 1, '2017-04-01 13:47:16'),
