(1, 'ناشيونال إيجيبت للسياحة', '01110775588', 'a.mohsen@mv-is.com', 'arabic', ' 35 عمارات العبور - صلاح سالم - القاهرة', '', 'عمرة, حج,سياحة,مصر,مكة,المدينةالمسجد الحرام,المسجدالنبوي,مناسك العمرة,مناسك الحج,الحج السياحى,حج القرعة,الداخلية,التضامن,قرعة الحج,', 'ناشيونال إيجيبت للسياحة افضل شركة سياحة دينية فى مصر بخبرة اكثر من 20 عاما و خدمة اكثر من 100 الف عميل\r\n', '{"facebook":"https:\\/\\/www.facebook.com\\/%D9%84%D8%A8%D9%8A%D9%83-%D8%AD%D8%AC%D8%A7-%D9%88%D8%B9%D9%85%D8%B1%D9%87-142945722521799\\/","twitter":"aaa","instagram":"aaa","google":"aaa","linkedin":"aaa","youtube":"https:\\/\\/www.youtube.com\\/channel\\/UCBo50ssmErxweuPtZivzB5w"}', 'National Bureau Of Egypt', '35 El Obour Buildings,  Salah Saleem St. Cairo', 'National Bureau Of Egypt is the best religious tourism company in Egypt with more than 20 years experience and serving more than 100,000 customers\r\n', 'Umrah', '', '', 'EG', 'USA', '200', '200', 11);
INSERT INTO `sightseeing` (`id`, `this_order`, `countries_id`, `cities_id`, `title_ar`, `title_en`, `image`, `body_ar`, `body_en`, `desc_ar`, `desc_en`, `keywords_ar`, `keywords_en`, `created_at`, `created_by`, `active`) VALUES
(1, 1, 72, 74, 'مكة المكرمة', 'asdsad', 's_524767_hajj_wallpaper_72-other.jpg', 'أم القرى، بها ولد نبي الإسلام محمد صلى الله عليه وسلم، وفي أحد جبالها نزل عليه الوحي، وفي قلبها المسجد الحرام، أعظم مسجد في الإسلام، تتوسطه الكعبة المشرفة قبلة المسلمين.\r\nالموقع\r\nتقع مكة المكرمة غرب المملكة العربية السعودية، وتبعد عن المدينة المنورة حوالي 400 كيلومتر في الاتجاه الجنوبي الغربي، وعن مدينة الطائف حوالي 120 كيلومترا في الاتجاه الشرقي، وعن العاصمة الاقتصادية جدة 72 كيلومترا.\r\nوهي في منطقة جبلية جرداء، ليس فيها شجر ولا ثمر عند تقاطع درجتي العرض 25/21 شمالا، والطول 49/39 شرقا، ضمن إقليم تهامة غرب شبه الجزيرة العربية على بعد 80 كلم من البحر الأحمر ضمن تشكيلات الدرع العربي الذي تتكون جباله من صخور متحولة، وصخور جوفية اندساسية، وصخور غرانيتية.\r\nوبين جبالها أودية تغطيها ترسبات الحصى والرمل، ومعظم هذه الأودية التي تتشكل منها مكة تتبع في تكوينها حركات الصدوع والانكسارات التي مرت بالدرع العربي خلال الأزمنة الجيولوجية القديمة.\r\nتبلغ مساحة مدينة مكة حوالي 850 كيلومترا منها 88 مأهولة بالسكان، وتبلغ مساحة المنطقة المركزية المحيطة بالمسجد الحرام المتربع وسط المدينة حوالي ستة كيلومترات، ويبلغ ارتفاعها عن مستوى سطح البحر حوالي 277 مترًا.', 'أم القرى، بها ولد نبي الإسلام محمد صلى الله عليه وسلم، وفي أحد جبالها نزل عليه الوحي، وفي قلبها المسجد الحرام، أعظم مسجد في الإسلام، تتوسطه الكعبة المشرفة قبلة المسلمين.\r\nالموقع\r\nتقع مكة المكرمة غرب المملكة العربية السعودية، وتبعد عن المدينة المنورة حوالي 400 كيلومتر في الاتجاه الجنوبي الغربي، وعن مدينة الطائف حوالي 120 كيلومترا في الاتجاه الشرقي، وعن العاصمة الاقتصادية جدة 72 كيلومترا.\r\nوهي في منطقة جبلية جرداء، ليس فيها شجر ولا ثمر عند تقاطع درجتي العرض 25/21 شمالا، والطول 49/39 شرقا، ضمن إقليم تهامة غرب شبه الجزيرة العربية على بعد 80 كلم من البحر الأحمر ضمن تشكيلات الدرع العربي الذي تتكون جباله من صخور متحولة، وصخور جوفية اندساسية، وصخور غرانيتية.\r\nوبين جبالها أودية تغطيها ترسبات الحصى والرمل، ومعظم هذه الأودية التي تتشكل منها مكة تتبع في تكوينها حركات الصدوع والانكسارات التي مرت بالدرع العربي خلال الأزمنة الجيولوجية القديمة.\r\nتبلغ مساحة مدينة مكة حوالي 850 كيلومترا منها 88 مأهولة بالسكان، وتبلغ مساحة المنطقة المركزية المحيطة بالمسجد الحرام المتربع وسط المدينة حوالي ستة كيلومترات، ويبلغ ارتفاعها عن مستوى سطح البحر حوالي 277 مترًا.', 'أم القرى، بها ولد نبي الإسلام محمد صلى الله عليه وسلم، وفي أحد جبالها نزل عليه الوحي، وفي قلبها المسجد الحرام، أعظم مسجد في الإسلام، تتوسطه الكعبة المشرفة قبلة المسلمين.', 'dsadasd', '', '', '2017-04-09 15:50:35', 0, 1),
